import React from "react";
import { NavLink } from "react-router-dom";

function NavBar({user, projectToView}) {

    const handleLogOut = () => {
        fetch("/logout", {
            method: "POST",
        })
        .then(window.location.reload())
    }

    return (
        <>
        {user ? (
            <div className="grid-col-1 left-0 top-0 h-screen flex flex-col gap-25 items-center">
                <NavLink to="/" class="text-2xl font-bold">Home</NavLink>
                <NavLink to="/create" class="text-2xl font-bold">Create</NavLink>
                <NavLink to="/your_projects" class="text-2xl font-bold">Your Projects</NavLink>
                {projectToView ? <NavLink to="/reviews/:id" class="text-2xl font-bold">Reviews</NavLink> : null}
                {user ? <button onClick={handleLogOut} class="text-2xl font-bold">Logout</button> : null}
            </div>
        ) : null

        }
        </>
    )
}

export default NavBar;
